import Login from "./components/Login"
import Register from "./components/Register"
import { useToken } from "./hooks/TokenContext"


function App() {
  const [token] = useToken()
  return (
    <div>
     <Register/> 
    {!token && <Login/>}
    </div>
  )
}

export default App
